import { Box } from "@mui/material";
import React from "react";
import Banner from "./Banner";
import NavBar from "./NavBar";

// Components import

const Component = styled(Box)`
background:#
padding:20px 10px;


`

const Home = () => {
  return (
    <>
      <NavBar></NavBar>
      <Component>
        <Banner></Banner>
      </Component>
    </>
  );
};

export default Home;
